Storyline:

    The summer of 1942 brought Naval stalemate to the Pacific as the American and Japanese fleets stood at even numbers each waiting for the other to begin a renewed offensive. &quot;Midway&quot; tells the story of this historic June battle where a Japanese carrier force, in an attempt to occupy Midway island and lure the American fleet to destruction, was meet valiantly by US forces operating off of three aircraft carriers and numerous escort ships. It was the first battle in which naval air power was extensively used, and at its conclusion the Japanese Carrier force had been completely destroyed which lead the way for the US 1943 and 44 offensives which would eventually bring the Pacific War to a close.




